func TestFileTool(t *testing.T) {
	data := ""
	err := Base64ToFile(data, "./1.png")
	if err != nil {
		t.Error(err)
	}
	err = CreateFile(data, "./1.txt")
	if err != nil {
		t.Error(err)
	}
}

func TestFilterTool(t *testing.T) {
	data := make([]string, 0)
	for i := 0; i < 2; i++ {
		for i := 0; i < 1000000; i++ {
			data = append(data, strconv.Itoa(i))
		}
	}
	t.Logf("去重前长度: %d", len(data))
	newData := RemoveRep(data)
	t.Logf("去重后长度: %d", len(newData))
}

