func TestRandomTool(t *testing.T) {
	rangeStrArr := make([]string, 0)
	var (
		wg    sync.WaitGroup
		mutex sync.Mutex
	)
	n := 100000
	for i := 0; i < n; i++ {
		wg.Add(1)
		rangeString := RangeString(6)
		go func() {
			mutex.Lock()
			rangeStrArr = append(rangeStrArr, rangeString)
			mutex.Unlock()
			wg.Done()
		}()
	}
	wg.Wait()
	t.Logf("rangeStrArr重复次数: %d", n-len(RemoveRep(rangeStrArr)))
}

func TestRSATool(t *testing.T) {
	pubKey, priKey, err := GenRsaKey(2048)
	if err != nil {
		t.Error(err)
		return
	}
	data, err := PublicEncrypt(pubKey, "123456")
	if err != nil {
		t.Error(err)
		return
	}
	t.Logf("加密: %s", data)
	out, err := PrivateDecrypt(priKey, data)
	if err != nil {
		t.Error(err)
		return
	}
	t.Logf("解密: %s", out)
}

